import React from "react";

const FormBody = props => {
  const ComputedTd = props.inputs.map((item,index) => {
    return (
      <tr key={index}>
        <td>{item.label}</td>
        <td>{item.content}</td>
      </tr>
    );
  });

  return (
      <tbody className="fontify">
      {ComputedTd}
      </tbody>
  );
};

export default FormBody;
